"use strict";(self.webpackChunkmyoyeon=self.webpackChunkmyoyeon||[]).push([[433],{5433:function(n,e,r){r.r(e);var s=r(184);e.default=function(){return(0,s.jsxs)(s.Fragment,{children:[(0,s.jsx)("div",{children:"Info"}),(0,s.jsx)("p",{children:"\uc785\uc591 \uc804 \uc9c4\uc9c0\ud558\uac8c \uc810\uac80\ud574\uc57c \ud560 \uccb4\ud06c\ub9ac\uc2a4\ud2b8 \ubc18\ub824\ub3d9\ubb3c\uc744 \ub9de\uc774\ud560 \ud658\uacbd\uc801 \uc900\ube44, \ub9c8\uc74c\uc758 \uac01\uc624\ub294 \ub418\uc5b4 \uc788\uc2b5\ub2c8\uae4c? \uac1c, \uace0\uc591\uc774\ub294 10~15\ub144 \uc774\uc0c1 \uc0bd\ub2c8\ub2e4. \uacb0\ud63c, \uc784\uc2e0, \uc720\ud559, \uc774\uc0ac \ub4f1\uc73c\ub85c \uac00\uc815\ud658\uacbd\uc774 \ubc14\ub00c\uc5b4\ub3c4 \ud55c\ubc88 \uc778\uc5f0\uc744 \ub9fa\uc740 \ub3d9\ubb3c\uc740 \ub05d\uae4c\uc9c0 \ucc45\uc784\uc9c0\uace0 \ubcf4\uc0b4\ud53c\uaca0\ub2e4\ub294 \uacb0\uc2ec\uc774 \uc130\uc2b5\ub2c8\uae4c? \ubaa8\ub4e0 \uac00\uc871\uacfc\uc758 \ud569\uc758\ub294 \ub418\uc5b4 \uc788\uc2b5\ub2c8\uae4c? \ubc18\ub824\ub3d9\ubb3c\uc744 \uae30\ub978 \uacbd\ud5d8\uc774 \uc788\uc2b5\ub2c8\uae4c? \ub0b4 \ub3d9\ubb3c\uc744 \uc704\ud574 \uacf5\ubd80\ud560 \uac01\uc624\uac00 \ub418\uc5b4 \uc788\uc2b5\ub2c8\uae4c? \uc544\ud50c \ub54c \uc801\uc808\ud55c \uce58\ub8cc\ub97c \ud574\uc8fc\uace0, \uc911\uc131\ud654\uc218\uc220(\ubd88\uc784\uc218\uc220)\uc744 \uc2e4\ucc9c\ud560 \uc0dd\uac01\uc785\ub2c8\uae4c? \uc785\uc591\uc73c\ub85c \uc778\ud55c \uacbd\uc81c\uc801 \ubd80\ub2f4\uc744 \uc9ca\uc5b4\uc9c8 \uc758\uc0ac\uc640 \ub2a5\ub825\uc774 \uc788\uc2b5\ub2c8\uae4c? \uc6b0\ub9ac \uc9d1\uc5d0\uc11c \ud0a4\uc6b0\ub294 \ub2e4\ub978 \ub3d9\ubb3c\uacfc \uc798 \uc5b4\uc6b8\ub9b4 \uc218 \uc788\uc744\uc9c0 \uace0\ubbfc\ud574\ubcf4\uc558\uc2b5\ub2c8\uae4c? \uc785\uc591 \uc2dc \uc77c\ubd80 \uacbd\ube44\uac00 \uccad\uad6c\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc2dc\xb7\uad70\xb7\uad6c\uccad\uc5d0\uc11c \ubcf4\ud638\ud558\uace0 \uc788\ub294 \uc720\uae30\ub3d9\ubb3c \uc911 \uacf5\uace0\ud55c \uc9c0 10\uc77c\uc774 \uc9c0\ub098\ub3c4 \uc8fc\uc778\uc774 \ub098\ud0c0\ub098\uc9c0 \uc54a\ub294 \uacbd\uc6b0 \uc77c\ubc18\uc778\uc5d0\uac8c \ubd84\uc591\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc785\uc591 \ubcf4\ud638\uc2dc\uc124\uc5d0 \ubbf8\ub9ac \uc804\ud654\ub85c \ubb38\uc758\ud558\uc2dc\uace0, \ub2f4\ub2f9\uc790\uc758 \uc548\ub0b4\uc5d0 \ub530\ub77c \ubc29\ubb38 \uc77c\uc2dc \ub4f1\uc744 \uc608\uc57d\ud569\ub2c8\ub2e4. \uc785\uc591 \uc2dc \uc2e0\ubd84\uc99d \ubcf5\uc0ac\ubcf8 2\uc7a5\uacfc \ud544\uc694\ud55c \ubc18\ub824\ub3d9\ubb3c \ubb3c\ud488\uc744 \uc900\ube44\ud558\uace0 \ubcf4\ud638\uc2dc\uc124\uc744 \ubc29\ubb38\ud574 \uc785\uc591\uacc4\uc57d\uc11c\ub97c \uc791\uc131\ud574\uc57c \ud569\ub2c8\ub2e4. \uc785\uc591 \ubcf4\ud638\uc2dc\uc124\uc5d0\ub294 \uc2e0\uccad\uc790 \ubcf8\uc778\uc774 \uc9c1\uc811 \ubc29\ubb38\ud574\uc57c \ud569\ub2c8\ub2e4. \ubbf8\uc131\ub144\uc790\uc5d0\uac8c\ub294 \ubc18\ub824\ub3d9\ubb3c\uc744 \ubd84\uc591\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ubd84\uc591\uc744 \uc6d0\ud558\ub294 \ubbf8\uc131\ub144\uc790\ub294 \ubd80\ubaa8\ub2d8\uc758 \ud5c8\ub77d\uc744 \uc5bb\uc5b4 \ubc18\ub4dc\uc2dc \ubd80\ubaa8\ub2d8\uacfc \ud568\uaed8 \ubc29\ubb38\ud574\uc57c \ud569\ub2c8\ub2e4."})]})}}}]);
